INSERT INTO `messages` (`from_user_id`, `to_user_id`, `type_id`, `body`, `created_at`) VALUES ('1', '1', 1, 'Odio est nisi voluptas nam. Voluptate quod quam quod eligendi amet vitae. Amet nesciunt illo sunt perspiciatis. Pariatur commodi aut ipsum nostrum voluptatem.', '1987-04-25 15:38:51');
INSERT INTO `messages` (`from_user_id`, `to_user_id`, `type_id`, `body`, `created_at`) VALUES ('1', '1', 2, 'Voluptatem repellendus eaque quae consequatur. Repellendus corrupti ut harum suscipit sint. Cumque ipsum aperiam modi dolore natus. Excepturi odio recusandae deserunt eveniet. Sequi voluptatem ut veniam quia libero ratione.', '2007-07-10 01:52:40');
INSERT INTO `messages` (`from_user_id`, `to_user_id`, `type_id`, `body`, `created_at`) VALUES ('2', '2', 2, 'Facere delectus iste vitae commodi officiis ex. Aspernatur officia numquam est eaque quaerat aliquid. Quae officia saepe voluptatem aut.', '2006-05-06 20:23:20');
